import styled from "styled-components";

export const StyledMain = styled.main`
  background-color: var(--color-gray-4);
  height: 100vh;

  section {
    border-bottom: 1px solid var(--color-gray-3);
    height: 25%;

    div {
      width: 70%;
      margin: 0 auto;
      display: flex;
      justify-content: space-between;
      align-items: center;
      height: 100%;

      h2 {
        //styleName: Title1;
        font-family: Inter;
        font-size: 18px;
        font-weight: 700;
        line-height: 28px;
        letter-spacing: 0em;
        text-align: left;
      }
    }
  }
`;
